import React from "react";
import link from "react-router-dom";
import "../styles/Beranda.css";

function Beranda() {
  return (
    <div className="beranda-container">
      <h1 className="beranda-title">Selamat Datang di Beranda</h1>
      <p className="beranda-description">Ini adalah halaman beranda setelah login.</p>
      <Link to="/profile">
        <button className="beranda-button">Profil</button>
      </Link>
      <Link to="/settings">
        <button className="beranda-button">Pengaturan</button>
      </Link>
    </div>
  );
}

export default Beranda;
